/* ... */
inline uintmax_t widthmaxof(unsigned char const width) /* noexcept */ {
  return width ? (((static_cast<uintmax_t>(1u) << (width - 1u)) - 1u) << 1u) + 1u : 0u;
}

template <std::size_t width, typename type>
inline static type debug_endian(type integer) throw() {
  type value = 0u;

  // …
  for (std::size_t count = sizeof integer; count--; ) {
    value     = (integer & widthmaxof(width)) | (value << width);
    integer >>= width;
  }

  return value;
}

inline static void debug(unsigned char byte) throw() {
  char  string[CHAR_BIT];
  char *iterator = string + CHAR_BIT;

  // ...
  for (unsigned count = CHAR_BIT; count--; byte >>= 1u)
    *--iterator = byte & 1u ? '1' : '0';

  (void) std::fprintf(stdout, "%*s", CHAR_BIT, string);
}

inline static void debug(void const volatile* const bytes, std::size_t length) throw() {
  for (unsigned char *iterator = (unsigned char*) bytes; length--; ++iterator) {
    debug(*(iterator++));
    (void) std::fprintf(stdout, "%0.*c", length ? 1 : 0, "-");
  }
}

